import React from 'react';

import { Breadcrumb, BreadcrumbItem, Container } from 'design-react-kit';

import 'bootstrap-italia/dist/css/bootstrap-italia.min.css';
import './App.scss';

import 'typeface-titillium-web';
import 'typeface-roboto-mono';
import 'typeface-lora';

const App = () => {
  return (
    <div className="App">
      <div className="ricerca-moduli">
        <Container className="page-header">
          <div className="breadcrumb-container">
            <Breadcrumb>
              <BreadcrumbItem>
                <a href="#">Home</a>
                <span className="separator">/</span>
              </BreadcrumbItem>
              <BreadcrumbItem>
                <a href="#">...</a>
                <span className="separator">/</span>
              </BreadcrumbItem>
              <BreadcrumbItem active>
                Motore di ricerca per moduli e documenti
              </BreadcrumbItem>
            </Breadcrumb>
          </div>

          <div className="text-container">
            <h2>Cerca patologie</h2>
            <p>
              Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed sed
              arcu molestie, rhoncus sapien id, venenatis turpis. Fusce ac
              congue odio
            </p>
          </div>
        </Container>
        <Container className="search-group"></Container>
        <Container className="result-table"></Container>
      </div>
    </div>
  );
};

export default App;
